// HomePage.js
import { useAuth0 } from '@auth0/auth0-react';
import './HomePage.css'
import React, { useState } from 'react';
;
import { Navbar, Nav, Button } from 'react-bootstrap';
const HomePage = () => {
  const { isAuthenticated, loginWithRedirect } = useAuth0();


 

function NavigationBar() {
  const { isAuthenticated, loginWithRedirect } = useAuth0();
  const [menuOpen, setMenuOpen] = useState(false);
}
  return (
    <Navbar bg="light" expand="lg">
      <Navbar.Brand href="#home">EzQuiz</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" onClick={() => setMenuOpen(!menuOpen)} />
      <Navbar.Collapse id="basic-navbar-nav" className={menuOpen ? 'show' : ''}>
        <Nav className="mr-auto">
          {/* Add your navigation links here */}
          {/* Example: <Nav.Link href="#link">Link</Nav.Link> */}
        </Nav>
        <Nav>
          {!isAuthenticated && <Button variant="primary" onClick={loginWithRedirect}>Log In</Button>}
          {isAuthenticated && (
            <Nav.Link href="#dashboard">Dashboard</Nav.Link>
           
          )}
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}






export default HomePage;
